import React, { useState } from 'react';
import {
    Container,
    Typography,
    TextField,
    Button,
    Box,
    Alert,
    CircularProgress,
    FormControl,
    Select,
    MenuItem,
    styled,
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import { supabase } from '../../utils/supabaseClient';

// スタイル付きコンポーネント
const StyledContainer = styled(Container)(({ theme }) => ({
    minHeight: '100vh',
    display: 'flex',
    alignItems: 'center',
    justifyContent: 'center',
    background: '#f5f5f5',
    padding: theme.spacing(3),
}));

const FormWrapper = styled(Box)(({ theme }) => ({
    backgroundColor: '#ffffff',
    borderRadius: '10px',
    padding: theme.spacing(4),
    width: '100%',
    maxWidth: '500px',
    boxShadow: '0 3px 6px rgba(0,0,0,0.1)',
}));

const StyledTextField = styled(TextField)(({ theme }) => ({
    marginBottom: theme.spacing(2),
    '& .MuiOutlinedInput-root': {
        '& fieldset': {
            borderColor: '#e0e0e0',
        },
        '&:hover fieldset': {
            borderColor: theme.palette.primary.main,
        },
        '&.Mui-focused fieldset': {
            borderColor: theme.palette.primary.main,
        },
    },
}));

const StyledButton = styled(Button)(({ theme }) => ({
    background: 'linear-gradient(45deg, #2196F3 30%, #21CBF3 90%)',
    border: 0,
    borderRadius: 3,
    boxShadow: '0 3px 5px 2px rgba(33, 203, 243, .3)',
    color: 'white',
    height: 48,
    padding: '0 30px',
    marginTop: theme.spacing(2),
    marginBottom: theme.spacing(2),
    '&:hover': {
        background: 'linear-gradient(45deg, #1976D2 30%, #00BCD4 90%)',
    },
}));

const StyledSelect = styled(Select)(({ theme }) => ({
    marginBottom: theme.spacing(2),
    '& .MuiOutlinedInput-notchedOutline': {
        borderColor: '#e0e0e0',
    },
    '&:hover .MuiOutlinedInput-notchedOutline': {
        borderColor: theme.palette.primary.main,
    },
    '&.Mui-focused .MuiOutlinedInput-notchedOutline': {
        borderColor: theme.palette.primary.main,
    },
}));

const StyledFormControl = styled(FormControl)(({ theme }) => ({
    marginBottom: theme.spacing(2),
    width: '100%',
}));

export default function Register() {
    // ... 前回のステート管理とロジック部分は同じ ...

    return (
        <StyledContainer>
            <FormWrapper>
                <Typography
                    variant="h4"
                    align="center"
                    gutterBottom
                    sx={{
                        fontWeight: 700,
                        color: '#1a237e',
                        marginBottom: 4
                    }}
                >
                    新規登録
                </Typography>

                {error && (
                    <Alert
                        severity="error"
                        sx={{
                            marginBottom: 2,
                            borderRadius: 2
                        }}
                    >
                        {error}
                    </Alert>
                )}

                <Box component="form" onSubmit={handleSubmit}>
                    <StyledTextField
                        required
                        fullWidth
                        label="名前（カタカナ）"
                        name="nameKana"
                        value={formData.nameKana}
                        onChange={handleChange}
                        error={!!fieldErrors.nameKana}
                        helperText={fieldErrors.nameKana}
                        disabled={loading}
                        variant="outlined"
                    />

                    <StyledTextField
                        required
                        fullWidth
                        label="希望ユーザーID"
                        name="userId"
                        value={formData.userId}
                        onChange={handleChange}
                        error={!!fieldErrors.userId}
                        helperText={fieldErrors.userId}
                        disabled={loading}
                        variant="outlined"
                    />

                    {/* 他のTextFieldも同様にStyledTextFieldに変更 */}

                    <StyledFormControl>
                        <StyledSelect
                            displayEmpty
                            value={formData.walletType}
                            onChange={handleChange}
                            name="walletType"
                            variant="outlined"
                            disabled={loading}
                        >
                            <MenuItem value="" disabled>
                                ウォレットタイプを選択
                            </MenuItem>
                            <MenuItem value="evo">EVOカード</MenuItem>
                            <MenuItem value="other">その他</MenuItem>
                        </StyledSelect>
                    </StyledFormControl>

                    <StyledButton
                        type="submit"
                        fullWidth
                        disabled={loading}
                    >
                        {loading ? (
                            <CircularProgress size={24} color="inherit" />
                        ) : (
                            '登録する'
                        )}
                    </StyledButton>

                    <Box sx={{
                        display: 'flex',
                        justifyContent: 'center',
                        gap: 2,
                        marginTop: 2
                    }}>
                        <Button
                            onClick={() => navigate('/')}
                            variant="text"
                            sx={{
                                color: '#666',
                                '&:hover': {
                                    color: '#000',
                                },
                            }}
                        >
                            ログインへ戻る
                        </Button>
                    </Box>
                </Box>
            </FormWrapper>
        </StyledContainer>
    );
}
